import { Link } from 'react-router-dom';


function Navigation(){
    return(

        <nav>
            <h2>Logo</h2>
            <ul>
                <li><Link to="/">Database</Link></li>
                <li><Link to="/login">Login Page</Link></li>
                <li><Link to="/about-us">About Us Page</Link></li>
            </ul>
        </nav>

    );
}

export default Navigation;
